import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="carouselExample2" className="carousel slide" data-ride="carousel">
      <div className="carousel-inner">
        <div className="carousel-item active">
          <img src="https://s3.ap-northeast-2.amazonaws.com/static.wanted.co.kr/homework/001.jpg" className="d-block w-100" alt="..."/>
        </div>
        <div className="carousel-item">
          <img src="../assets/img/img3.jpg" className="d-block w-100" alt="..."/>
        </div>
        <div className="carousel-item">
          <img src="../assets/img/img3.jpg" className="d-block w-100" alt="..."/>
        </div>
      </div>

      <a className="carousel-control-prev" href="#carouselExample2" role="button" data-slide="prev">
        <span className="carousel-control-prev-icon" aria-hidden="true"><i data-feather="chevron-left"></i></span>
        <span className="sr-only">Previous</span>
      </a>
      <a className="carousel-control-next" href="#carouselExample2" role="button" data-slide="next">
        <span className="carousel-control-next-icon" aria-hidden="true"><i data-feather="chevron-right"></i></span>
        <span className="sr-only">Next</span>
      </a>
    </div>
  );
}

export default App;
